import Navbar from '../Navbar/Navbar';
import "./Products.css";
// import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";

const Product = () => {
    return (
        <div>
            <Navbar />
            <div className="container">
                <button className="btn btn-success">JKT</button>
                
            </div>
            
        </div>
    )
}

export default Product;
